INSERT INTO `blogs` (`bl_id`, `content`, `bl_name`, `author`, `date`, `title`, `blog_image1`, `blog_image2`, `blog_image3`, `pos`) VALUES
(1, 'Having a consistent and effective skincare routine is the key to achieving and maintaining healthy, radiant skin. In this comprehensive guide, we will walk you through the essential steps to create a personalized skincare routine that addresses your unique skin concerns and goals.\r\n\r\nDetermine Your Skin Type:\r\nUnderstanding your skin type is crucial for selecting the right products and treatments. We explain the characteristics of different skin types, such as oily, dry, combination, and sensitive, and provide tips on how to identify your skin type.\r\n\r\nCleanse Properly:\r\nDiscover the importance of cleansing and how to choose the right cleanser for your skin type. We discuss different types of cleansers, such as foaming, gel, and oil-based, and provide guidelines on how to cleanse your skin effectively to remove impurities without stripping away its natural moisture.\r\n\r\nExfoliation:\r\nLearn about the benefits of exfoliation and the various methods available, including physical scrubs, chemical exfoliants, and exfoliating tools. We explain how exfoliation helps remove dead skin cells, unclog pores, and improve skin texture, and offer tips on incorporating exfoliation into your routine.\r\n\r\nHydration and Moisturization:\r\nDiscover the importance of keeping your skin hydrated and nourished. We delve into the difference between hydration and moisturization and recommend suitable products, such as hydrating toners, serums, and moisturizers, for different skin types. We also discuss the benefits of incorporating facial oils and masks into your routine.\r\n\r\nTargeted Treatments:\r\nAddress specific skin concerns, such as acne, hyperpigmentation, and aging, with targeted treatments. We explore ingredients like salicylic acid, retinol, vitamin C, and niacinamide and explain how they can help improve various skin conditions. Additionally, we provide tips on layering treatments and the importance of introducing them gradually into your routine.\r\n\r\nSun Protection:\r\nEmphasize the significance of sun protection and the role it plays in maintaining healthy skin. We discuss the importance of wearing sunscreen daily, provide guidance on choosing the right SPF, and recommend incorporating sunscreen into your morning skincare routine.\r\n\r\nLifestyle Factors:\r\nHighlight the impact of lifestyle factors on your skin\'s health. We cover topics such as the importance of a balanced diet, the benefits of staying hydrated, the role of sleep in skin rejuvenation, and the significance of managing stress for healthy skin.', 'SkinCare', 'Neta Raj', '2023-06-01', 'Healthy Skin Healthy You', , , , 2);
INSERT INTO `blogs` (`bl_id`, `content`, `bl_name`, `author`, `date`, `title`, `blog_image1`, `blog_image2`, `blog_image3`, `pos`) VALUES
(14, 'I love doing a smokey eye – especially when it’s not just basic black. Playing with various tones of brown is one of my favorite things to do for nearly all skin tones – from the most fair, to deep, dark complexions, and all shades in between. To recreate the above look I did on Annaliese, for yourself, you’ll need: Two brown shadows (i chose Transcend from Kjaer Weis as my base shade, and Wisdom, also from Kjaer Weis, as my deeper shade – and when layered, the two created the deepest part around the crease and lash lines) A black eyeliner pencil (I chose Hypnotist from W3LL People) A creamy brown shimmery eye crayon (I chose Age of Consent from Ilia Beauty) A creamy highlighter for the inner corners (I like Ilia Beauty ‘Cosmic Dancer‘) Begin by outlining the shape you’ll want with the lightest of your two brown shades. On all face shapes – no matter your eye shape – the most flattering overall shadow look is one that angles slightly upwards at the outer edge of the eye. This is why so many youtube video makeup tutorials show a short piece of tape being applied to the outer edge, so that no shadow (or liner) falls/is drawn below it. Shadow or liner that has a downward sloping outer edge tends to drag the face down. Once you’ve pressed (notice I specify to PRESS your shadow into your skin. Do not sweep or fan your color on. The correct placement of the pigment is what sets apart a messy shadowed eye from a beautifully done smokey eye, and for the latter, you’ll need to be precise about how much and where you put it!) your light brown shadow into the approximate shape that is most flattering to your face (experiment! You can always use cotton swabs to wipe away what doesn’t look good), you can begin pressing your deeper brown shadow in a sideways V form, starting along the outer corner of the eye, and along the crease (if your eye has a crease, of course). Take a good fluffy eyeshadow brush and blend, blend, blend, so that the two become seamless, and the edges are diffused into your naked skin. Take your sharpened black liner and gently dot along the top lash line, smudging along the way with a skinny smudge brush, or cotton swab. Experiment with your eye shape – does a bit of black liner smudged along the bottom lash line look good? Then do it! Finish the look by adding your highlights: Using the creamy, shimmery brown shadow crayon, drag it along the top of the lash line, just behind the lashes, staying close to the lash line. This will serve to highlight the area behind your lashes, drawing attention to them. Take your creamy pale highlighter (choose a deeper shade if your skin tone is darker than Annaliese), and press it into the inner corner of your eyes for a little added flare. Curl and coat your lashes with a few swipes of black mascara… et voila! BEAUTY! xx', 'Makeup', 'vaibhavi nile', '2023-06-04', 'Smokey Eyes', , , '', 1);
INSERT INTO `blogs` (`bl_id`, `content`, `bl_name`, `author`, `date`, `title`, `blog_image1`, `blog_image2`, `blog_image3`, `pos`) VALUES
(15, 'I usually want to go all-out on the makeup when it comes to Amber Heard. Her face is a makeup artists dream come true; she looks great in a smokey eye, an intense brow, and a serious lip. Last night, however, she said to me: ‘I really want to look super natural for the [Jimmy Kimmel] show tonight, and most importantly, I want my skin to glow.’\r\n\r\nGlowing skin is my forte (sometimes I think I should carry powder in my kit), so I was stoked for this request. Here’s a breakdown of how you can recreate this glow on yourself. Keep in mind, I wouldn’t necessarily recommend this level of glow intensity as an every day look for everyone, but it’s definitely a show-stopper.\r\n\r\nStart with a clean face.\r\nEnjoy a hearty mist of RL Linden Thousand Petals Mist all over face, neck, and decollate\r\n3-4 few drops of Jenette Skincare Facial Oil (let this sit for a few minutes)\r\n8 drops of Marie Veronique Organics Healing Facial Oil\r\nA light pressing of Tammy Fender’s Intensive Repair Balm along the highlights of the face\r\nBecause oils have different viscosities (levels of heaviness/thickness), it’s important to know what’s in your face oil. For a request like this, I’ll often layer a lighter oil under a heavier, and finish by sealing it in with a moisturizer.\r\nFor most of us, a heavy application of oils and moisturizers every day isn’t what our skin needs, so remember: this intensity of product usage is only for special occasions!\r\n\r\nI let the moisture sit for at least 5 minutes (sometimes 15!) before I start in with makeup.\r\n\r\nBecause Amber’s skin is impeccably clear, and even-toned (lucky dog!) I used a brush to apply the smallest amount of liquid foundation from Vapour Organic Beauty along her t-zone (this foundation is VERY dewey!), and a yet-to-be-released under eye concealer from w3LL People (stay tuned – it’s great).\r\n\r\nFocusing again on the highlights, I used my fingers to press a bit of Vapour Organic Beauty’s new glowy stick along her cheekbones, the bridge of her nose, and even though for some of you, it may have looked a bit over-the-top luminescent, along her temples and into her forehead (I like a glow there, but I know some of you who don’t).\r\n\r\nHistorically, television makeup has been matte, and is generally super powder-heavy, which makes sense because depending on the lighting and the type of camera used, shiny-ness can be distracting and come across as looking oily. It’s up to us makeup artists to determine just how much glow is appropriate, and hope that what looks good in dressing room lighting looks just as good on stage!\r\n\r\n(side note: one of the other guests on the show came into Amber’s dressing room to say hello. It was comical for me to see how much white powder had been put on his face. He looked like a ghost in person! When they hugged and kissed hello I feared some of it would come off on her cheek. It didn’t, and when I saw him on the show his skin looked great. I have a lot of respect for you television and movie makeup artists. It’s a totally different ball game!)', 'skincare', 'Bhakti Nile', '2023-05-01', 'Make your skin glow', , , , 1);
INSERT INTO `blogs` (`bl_id`, `content`, `bl_name`, `author`, `date`, `title`, `blog_image1`, `blog_image2`, `blog_image3`, `pos`) VALUES
(18, 'Getting your festival look spot on is not easy, especially when it comes to your hair. If you’re camping, without easy access to showers (or showers you’ll actually want to use), you’ll probably want your hair out of your face, but a tight topknot isn’t the most fun style you can choose. If you’re looking for some fun festival hair inspiration, try these styles on for size… FISHTAIL BRAID Braids and festival hair go hand in hand, but you might want something slightly more exciting that your standard French braid or pigtails for your look. The fishtail braid is a great option because although it looks super complicated it’s actually really easy to do on yourself, as it uses only two strands of hair, rather than three. The easiest way to get to grips with this style is to practice alongside a YouTube tutorial like this one but just remember to sweep hair to one side and pack a few bobby pins to secure flyaways into place.', 'haircare', 'Bhavna Nile', '2022-12-14', '4 Festival Hair Looks for SUMMER', , '', '', 0);
INSERT INTO `blogs` (`bl_id`, `content`, `bl_name`, `author`, `date`, `title`, `blog_image1`, `blog_image2`, `blog_image3`, `pos`) VALUES
(20, 'The peach makeup trend has been hotting up since 2022, and now that summer 2023 is underway, it’s time to add some extra flavour to your style with some fruity peach hues. People often make the mistake of thinking that gold and bronze tones are the only option for the hotter months, but since orange sits opposite blue on the colour wheel, peach tones have the capacity to warm up your skin tone, making them a great option to correct and brighten a host of skin tones. This warming, bright tone is a great way to give skin a boost and make it look a bit less tired in an instant – perfect if you’re too busy having fun in the sun to get a full eight hours sleep every night.\r\n\r\nHOW TO WEAR PEACH MAKEUP\r\nThe great thing about this trend is that it’s super versatile. You can go subtle with a peach tone foundation and a hint of blush, or you can go bold with peach eyeshadow or lipstick. Generally speaking, paler skin tones will look better with a pale, pastel tone, while darker skin tones will suit a bold, bright peach. But beauty rules are made to be broken, so why not get experimental this season?', 'Makeup', 'Rudraksh Nile', '2021-09-07', 'TRENDING: Peach Makeup For Summer', , , , 0);
INSERT INTO `blogs` (`bl_id`, `content`, `bl_name`, `author`, `date`, `title`, `blog_image1`, `blog_image2`, `blog_image3`, `pos`) VALUES
(21, 'I want my makeup to feel light, look glowy and sheer, and basically, just make me look like the best version of myself’.\r\n\r\nUnless I’m doing makeup for an editorial, 90% of the time this is what I hear from the person I’m about to make up.  It’s come to be my favorite kind of makeup look to create, in large part because I love watching my clients reaction when I’m finished. Who doesn’t like to make people feel good about themselves? It may be a superficial ‘feel good’ at first, but it seeps in. I watch moods change, frown lines soften, and interactions with others become lighter and more at ease.  Makeup really is transformative, and it doesn’t need to be heavy anywhere on your face, contrary to the heavy eye and brow makeup and pancake face with highlights and lowlights and contour and strobe trend that just won’t seem to go away.\r\n\r\nThis is what I used for this light and glowing makeup on the beautiful Anna-Christina Schwartz:\r\n\r\nSkin:\r\n\r\nMay Lindstrom Jasmine Garden Facial Mist– the scent is incredible and I use it as much for the aromatherapy for myself, as I do for my clients.\r\n\r\nBiossance ‘The Revitalizer’ – a super light squalene moisturizer that’s good for all skin types.\r\n\r\nKjaer Weis Foundation – I use a fluffy eyeshadow brush to gently buff the cream into skin – the smallest amount around her nose, on her forehead, and around her eyes, patting it in with a damp beauty blender.\r\n\r\nRMS Living Luminizer – not a surprise, I love to use this coconut oil based highlighter on the cheekbones, along the bridge of the nose, and the cupids bow.\r\nEyes:\r\n\r\nI lined her eyes gently with cream shadow sticks from Ilia Beauty, in a gold/brown called ‘Age of Consent’, and a bit more heavily with ‘You Spin Me Round’ – a dark gray/black shade. I blended them in with a cotton swab so they melted into the lash line – both top and bottom.\r\n\r\nIlia Polka Dots and Moonbeams luminizer – I press this more dense, less emollient (than the living luminizer from RMS) highlighter into the inner corner of eyes to draw attention and make eyes dazzle even more.\r\n\r\nI always curl the lashes at least once, focusing on getting that outer corner UP! It really makes eyes stand out. Two or three coats of a very black mascara on top, and one slight coat on the bottom lashes finishes the look.\r\n\r\nBrows: Eco Brow in ‘Sharon’ lightly filled in her brows, and I used a cotton swab to ensure no hard edges. I brushed her brows up and held them in place with a little liquid (non-aresol) hairspray from Rahua on a spoolie brush.\r\n\r\nCheeks:\r\n\r\nI usually use cream products that I swirl on the apples of the cheeks, but for this look I experimented by mixing a powder blush with a powder bronzer. For this I used ‘Blushing Rose’ and ‘Soft Terracotta’ from Dr. Hauschka and a medium sized fluffy brush.\r\n\r\nLips:\r\n\r\nGressa Skin ‘Bare’ Lip Boost over a bit of balm from R.L Linden. \r\n\r\n', 'skincare', 'Sakshi shinde', '2023-05-28', 'A GOOD HABIT', , , , 0);
